def show_song(song_nb):
    oled.fill(0)
    oled.text("Goedemorgen Prof", 0, 0)
    oled.text(songs_text[song_nb], 0, 40)
    oled.show()


def show_default_text():
    oled.fill(0)
    oled.text("Welkom", 0, 0)
    oled.text("", 0, 40)
    oled.show()


def play_song(song_nb):
    mySong = music(songs_music[song_nb], pins=[Pin(Buzzerpin)])
    count = 0
    while count < COUNT_MAX:
        mySong.tick()
        sleep(0.04)
        count +=1

    mySong.stop()

def calc_level(value, ref_value):
    print(value, ref_value)
    #value = value*MAX_V/ref_value
    print(value)
    return min(int(value / (MAX_V/(NB_LEVELS+1))), NB_LEVELS)


